import React, { Component } from 'react';
import Card from './Card';
import PropTypes from 'prop-types';

export default class CardList extends Component {
  render() {
    const { date } = this.props;
    return (
      <section>
        { date.map(() => {
          <Card />
        }) }

      </section>
    )
  }
}

Card.propTypes = {
  date: PropTypes.arr.isRequired,
};
